import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import api from "../utils/api";
import { 
  ArrowLeft, Search, Trophy, Eye, Calendar, User, Target, Bell, FileText, AlertTriangle
} from "lucide-react";
import { motion } from "framer-motion";
import "../dashboard.css";

function ResultsPage() {
  const [studentResults, setStudentResults] = useState([]);
  const [filteredResults, setFilteredResults] = useState([]);
  const [selectedResult, setSelectedResult] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");
  const [studentSearchTerm, setStudentSearchTerm] = useState("");
  const [testSearchTerm, setTestSearchTerm] = useState("");
  const [loadingResults, setLoadingResults] = useState(false);
  const [assignments, setAssignments] = useState([]);
  const [notifications, setNotifications] = useState([]);
  const [showOlderItems, setShowOlderItems] = useState(false);
  const navigate = useNavigate();

  // Fetch student results
  useEffect(() => {
    const fetchStudentResults = async () => {
      setLoadingResults(true);
      try {
        const { data } = await api.get("/submissions/mentor");
        if (data && Array.isArray(data)) {
          setStudentResults(data);
          setFilteredResults(data);
        } else {
          setStudentResults([]);
          setFilteredResults([]);
        }
      } catch (err) {
        console.error("Failed to fetch student results:", err);
        setStudentResults([]);
        setFilteredResults([]);
      } finally {
        setLoadingResults(false);
      }
    };
    fetchStudentResults();
  }, []);

  // Filter results
  useEffect(() => {
    let results = [...studentResults];

    if (searchTerm) {
      results = results.filter(result => {
        const studentName = result.student?.name || "Unknown Student";
        const testName = result.test?.name || result.testName || "Unknown Test";
        return studentName.toLowerCase().includes(searchTerm.toLowerCase()) ||
               testName.toLowerCase().includes(searchTerm.toLowerCase());
      });
    }

    if (studentSearchTerm) {
      results = results.filter(result => {
        const studentName = result.student?.name || "Unknown Student";
        return studentName.toLowerCase().includes(studentSearchTerm.toLowerCase());
      });
    }

    if (testSearchTerm) {
      results = results.filter(result => {
        const testName = result.test?.name || result.testName || "Unknown Test";
        return testName.toLowerCase().includes(testSearchTerm.toLowerCase());
      });
    }

    setFilteredResults(results);
  }, [studentResults, searchTerm, studentSearchTerm, testSearchTerm]);

  // Fetch assignments and notifications
  useEffect(() => {
    const fetchStudentData = async () => {
      try {
        const assignmentsRes = await api.get("/student/assignments");
        setAssignments(assignmentsRes.data || []);
        
        const notificationsRes = await api.get("/student/notifications");
        setNotifications(notificationsRes.data || []);
      } catch (err) {
        console.error("Failed to fetch student data:", err);
      }
    };
    fetchStudentData();
  }, []);

  // Helpers
  const getColor = (percent) => {
    if (percent < 35) return "#ef4444";
    if (percent <= 80) return "#f59e0b";
    return "#10b981";
  };

  const getGrade = (percent) => {
    if (percent >= 90) return "A+";
    if (percent >= 80) return "A";
    if (percent >= 70) return "B+";
    if (percent >= 60) return "B";
    if (percent >= 50) return "C";
    if (percent >= 35) return "D";
    return "F";
  };

  const formatDate = (timestamp) => {
    if (!timestamp) return "N/A";
    try {
      const date = new Date(timestamp);
      return date.toLocaleDateString("en-US", {
        year: "numeric",
        month: "short",
        day: "numeric",
        hour: "2-digit",
        minute: "2-digit",
      });
    } catch {
      return "Invalid Date";
    }
  };

  return (
    <div className="dashboard-container">
      {/* ------- Header ------- */}
      <div className="dashboard-header">
        <div className="header-content">
          <button
            onClick={() => navigate("/dashboard-mentor")}
            className="flex items-center text-white mb-4 hover:text-blue-200 transition-colors"
          >
            <ArrowLeft className="w-5 h-5 mr-2" />
            Back to Dashboard
          </button>
          <h1 className="dashboard-title">Student Results</h1>
          <p className="dashboard-subtitle">View and analyze student performance</p>
        </div>
      </div>

      {/* ------- Search Section ------- */}
      {/* ... same JSX as in your code above ... */}

      {/* ------- Results Grid ------- */}
      {/* ... same JSX as in your code above ... */}

      {/* ------- Modal, Student Activities Section ------- */}
      {/* ... same JSX as in your code above ... */}
    </div>
  );
}

export default ResultsPage;
